import React from "react";
import { Image, ImageBackground } from "react-native";

export default function Images({images}) {
    let imagesComp = []

    for(let i=0; i<images.length; i++) {
        imagesComp.push(<ImageBackground source={require(images[0])}/>)
    }

    return (
        <>
            {imagesComp}
        </>
    );

}
